<script>
	export default{
		data() {
			return {
				merchant:{},
				income:{},
				shopCount:{},
				Trurl:''
			}
		},
		computed:{
			userInfo(){
				return this.$store.state.userInfo;
			},
			merchantId(){ //商家id
				return this.$store.state.goods.merchantId || '';
			},
		},
		methods:{
			// 提现
			goBusinessWithdraw() {
				uni.navigateTo({
					url:`/businessPages/businessWithdraw/index`
				})
			},
			//跳转订单页
			clickOrder(index){
				uni.navigateTo({
					url:`/businessPages/shop/order?index=${index}`
				})
			},
			goWhere(url){ //进入相应页面
				uni.navigateTo({
					url
				})
			},
			jinjian(url){
				uni.navigateTo({
					url:this.Trurl||url
				})
			},
			getJInjian(){
				let id = this.userInfo.id;
				this.$fly.post('/entry/findMerchantEntryByUserId?userId='+id).then(res=>{
					if(res.code == 0){
						if(res.data && (res.data.status === 'AUDITED' || res.data.status === 'PASS')){
							this.Trurl = `/businessPages/review/index`;
						}else if(res.data.status === 'FINISH'){
							this.Trurl = `/businessPages/review/pass`;
						}
					}
				})
			},
			getMerchant(){  //获取商户信息
				this.$fly.get(`/merchant/getMerchantByUserId/${this.$store.state.userInfo.id}`)
				.then(res=>{
					if(res.code == 0){
						// res.data.merchant.alipayPaymentUrl = res.data.merchant.alipayPaymentUrl;
						this.merchant = res.data;
						this.$store.commit('SETMerchantId',res.data.merchant.id);
						this.shopCountFun(res.data.merchant.id)
					}
				})
			},
			goProfitList(){ //进入分润明细列表页面
				// uni.navigateTo({
				// 	url:`/operationPages/profitList/index?id=${this.merchant.id}&type=LOCK_FANS_MERCHANT_PROFIT`
				// })
				uni.navigateTo({
					url:'/userPages/coinList/index'
				})
			},
			async shopCountFun(id){
				try{
					uni.showLoading({
						title:'加载中'
					})
					
					let {shopCount} = this;
					let shopCountAjax = await this.$fly.get('/app/order/count',{id});
					this.shopCount = shopCountAjax.data;
				}catch(e){
					uni.showToast({
					    title: '拉取商品数量失败！',
					    duration: 2000
					});
					console.error(e)
				}finally{
					uni.hideLoading();
				}
			},
		},
		onLoad:function(){
			this.getMerchant();
		},
		onShow() {
			this.getJInjian();
		}
	}
</script>

